import { useEffect, createContext, useContext, useReducer } from 'react'
import axios from 'axios';

const DentistState = createContext();

const initialState = {
    dentistList: [],
    dentist: {}
}

const reducer = (state, action) => {
    switch(action.type){
        case 'GET_LIST_DENTIST':
            return {dentistList: action.payload, dentist: state.dentist}
        case 'GET_DENTIST':
            return {dentistList: state.dentistList, dentist: action.dentist}
        default:
            throw new Error()
    }
}

const Context = ({children}) => {
    const [dentistState, dentistDispatch] = useReducer(reducer, initialState)
    const url = 'https://jsonplaceholder.typicode.com/users'

    useEffect(() => {
      axios(url)
      .then(res => res.data)
    }, [])

  return (
    <DentistState.Provider value={{ dentistState, dentistDispatch }}>
        {children}
    </DentistState.Provider>
  )
}

export default Context

export const useDentistState = () => useContext(DentistState)
